import './Components/images.png';
import Login from './Components/Login.js';
import home from './Components/home.js';
import { BrowserRouter as Router,Routes,Navigate,Route } from 'react-router-dom';
function App() {
  return (
    <Router>
    <Routes>
        <Route path="./Components/Login.js" element={<Login />} />
        <Route path="./Components/Login.js" element={<home />} />

        <Route path="*" element={<Navigate to="./Components/Login.js" replace />} /> // Catch-all route for other paths
    </Routes>
</Router>
  );
}

export default App;
